import React from 'react';

function ReportPage() {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Báo cáo của tôi</h1>
      <p className="body_1">Đây là nơi hiển thị thông tin báo cáo.</p>
    </div>
  );
}

export default ReportPage;
